// Function to compute the greatest common divisor (GCD) of two numbers using the Euclidean algorithm
func gcd(a, b int) int {
	a, b = int(math.Max(float64(a), float64(b))), int(math.Min(float64(a), float64(b)))
	for a%b!= 0 {
		a, b = b, a%b
	}
	return b
}

// Function to process the input string character by character
func process(s string) string {
	t := ""
	i := 0
	for i < len(s) {
		if s[i] == 'A' {
			t += "A"
			i += 1
		} else if s[i] == 'B' {
			if i < len(s)-1 {
				if s[i+1] == 'C' {
					t += "D"
					i += 2
				} else {
					t += "X"
					i += 1
				}
			} else {
				t += "X"
				i += 1
			}
		} else {
			t += "X"
			i += 1
		}
	}
	return t
}

// Function to count the number of 'A' characters before each 'X' in the processed string
func count(t string) int {
	total := 0
	numA := 0
	for i := 0; i < len(t); i++ {
		if t[i] == 'X' {
			numA = 0
		} else {
			if t[i] == 'A' {
				numA += 1
			} else {
				total += numA
			}
		}
	}
	return total
}

